import React, { useEffect } from 'react';

const HousecallProChat = () => {
    useEffect(() => {
        // Create script element
        const script = document.createElement('script');

        // Set script attributes
        script.src = 'https://chat.housecallpro.com/proChat.js';
        script.type = 'text/javascript';
        script.setAttribute('data-color', '#034f9b');
        script.setAttribute('data-organization', 'a38b69a4-4512-44e6-9e6c-b7edceb5bca2');
        script.async = true;

        // Append the script to the body
        document.body.appendChild(script);

        // Clean-up function
        return () => {
            document.body.removeChild(script);
        };
    }, []);

    return null;
};

export default HousecallProChat;
